import React, { useMemo, useState } from 'react';
import { TAX, TAX_COLUMN } from '../../assets/Json/TAX';
import { TableC } from '../../components/Table/TableC';

const Tax = () => {
  const columns = useMemo(() => TAX_COLUMN, []);
  const data = useMemo(() => TAX, []);
  const [transition, settransition] = useState(false);
  return (
    <Container>
      <h4 className='pt-4 pb-5'>{heading}</h4>
      <div className='d-flex w-60 ml-3  mb-3 filters'>
        <div className='d-flex flex-column mr-3 w-100'>
          <span>{searchTitle}</span>
          <InputGroup size='sm'>
            <Input
              value={filterInput}
              onChange={handleFilterChange}
              placeholder={searchPlaceHolder}
            />
            <InputGroupAddon addonType='append'>
              <InputGroupText>
                <FontAwesomeIcon className='icon' icon={faSearch} />
              </InputGroupText>
            </InputGroupAddon>
          </InputGroup>
        </div>
        <div className='d-flex flex-column mr-3 w-100'>
          <span>State</span>
          <InputGroup size='sm'>
            <Input
              type='select'
              name='select'
              onChange={(e) => handleSelectFilterChange(e)}
              id='exampleSelect'>
              <option value=''>All</option>
              {dropdownList.map((data, index) => {
                return (
                  <option value={data} key={index}>
                    {data}
                  </option>
                );
              })}
            </Input>
          </InputGroup>
        </div>
      </div>
      {/* <TableC
      columns={columns}
      searchTitle='HSN Code'
      searchPlaceHolder='Search HSN Code'
      dropdownList={['Transition Value', 'Per-Unit']}
      data={data}
      heading='TAX'
      filter='code'
      dropfilter=''
    /> */}
    </Container>
  );
};

export default Tax;
